import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Background from "./beerbarrel.jpg";

const Home = props => {
  return (
    <section style={styles}>
      <div>
        <Search />
        <Breweries />
      </div>
    </section>
  );
};

const styles = {
  backgroundImage: `url(${Background})`
};

Home.propTypes = {};

export default Home;
